{
  "version": "0.2",
  "phases": {
    "pre_build": {
      "commands": [
        "npm ci"
      ]
    },
    "build": {
      "commands": [
        "npm run build"
      ]
    },
    "post_build": {
      "commands": [
        "cp -r .next/standalone/* .",
        "cp -r .next/static .next/standalone/.next/",
        "cp -r public .next/standalone/",
        "aws s3 sync .next/standalone/ s3://${WEBSITE_BUCKET_NAME}/ --delete",
        "aws cloudfront create-invalidation --distribution-id ${DISTRIBUTION_ID} --paths \"/*\"",
        "echo \"Contents of .next/standalone:\"",
        "ls -la .next/standalone",
        "echo \"Contents of S3 bucket:\"",
        "aws s3 ls s3://${WEBSITE_BUCKET_NAME}/"
      ]
    }
  },
  "artifacts": {
    "base-directory": ".next/standalone",
    "files": [
      "**/*"
    ]
  }
}
